&gt; Plot Synopsis: An American law student in London. Knocked down by a black cab, 
&gt; she wakes with amnesia in a world that's a million miles from home - Wonderland.
&gt; We follow her adventures as she's dragged through an underworld filled with 
&gt; twisted individuals and the lowest low-lifers, by the enigmatic cab driver, 
&gt; Whitey. She needs to find out who she is, where she's from and use what wits she
&gt; has left to get back home in one piece. As her journey progresses she discovers 
&gt; nothing is what it seems, realizes that fate and life are terminally entwined, 
&gt; and finds true love lurking in the unlikeliest place.
